import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        id="name"
        name="name"
        placeholder="Name"
        value={name}
        onChange={(e) => setName(e.target.value)}
        required
        ></input>

        <input
        type="tel"
        id="phone"
        name="phone"
        placeholder="Phone"
        value={name}
        onChange={(e) => setPhone(e.target.value)}
        pattern="^\d{10}$"
        required
        ></input>

        <input
        type="email"
        id="email"
        name="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        pattern="^\d{10}$"
        required
        ></input>
    </form>
  );
};
